/// <summary>
///    Returns a string representing the selected criterias
///    If nothing is selected a string containing all values are returned
/// </summary>
/// <returns>
///    A string.
/// </returns>
public str statusSelectionStr()
{
    str                 statusSelectionStr = '';

    if (showAllValue)
    {
        return enum2str(StatusIssue::OnOrder) + ',' + enum2str(StatusIssue::ReservOrdered) + ',' + enum2str(StatusIssue::ReservPhysical);
    }

    if (showStatusOnOrder)
    {
        statusSelectionStr += enum2str(StatusIssue::OnOrder);
    }

    if (showStatusReservedOrdered)
    {
        if (statusSelectionStr)
        {
            statusSelectionStr += ',';
        }

        statusSelectionStr += enum2str(StatusIssue::ReservOrdered);
    }

    if (showStatusReservedPhysical)
    {
        if (statusSelectionStr)
        {
            statusSelectionStr += ',';
        }

        statusSelectionStr += enum2str(StatusIssue::ReservPhysical);
    }

    if (!statusSelectionStr)
    {
        statusSelectionStr = enum2str(StatusIssue::OnOrder) + ',' + enum2str(StatusIssue::ReservOrdered) + ',' + enum2str(StatusIssue::ReservPhysical);
    }

    return statusSelectionStr;
}

public boolean unpack(container _packedClass)
{
    Integer     version     = RunBase::getVersion(_packedClass);

    switch (version)
    {
        case #CurrentVersion :
            [version,#CurrentList] = _packedClass;
            break;
        default :
            return false;
    }

    return true;
}

public void updateDesign(InventDimFormDesignUpdate _mode)
{
    switch (_mode)
    {
        case InventDimFormDesignUpdate::Init          :
            if (!inventDimFormSetup)
            {
                inventDimFormSetup  = element.inventDimSetupObject();
            }
            inventDimFormSetup.parmDimParmEnabled(null);
            inventDimFormSetup.parmDimParmVisibleGrid(inventDimParm);
            inventDimFormSetup.formSetControls(true,true);
            break;

        default : throw error(strFmt("@SYS54195",funcName()));
    }
}

public Set getUnsupportedTransactionTypes()
{
    Set transactionTypesToFilterOut = new Set(Types::Enum);

    transactionTypesToFilterOut.add(InventTransType::WHSWork);
    transactionTypesToFilterOut.add(InventTransType::WHSContainer);
    transactionTypesToFilterOut.add(InventTransType::WHSQuarantine);
    transactionTypesToFilterOut.add(InventTransType::WHSOrderCommittedReservation);
    transactionTypesToFilterOut.add(InventTransType::WHSInventTransArchiveOnlyAffectsLocationAndBelow);

    return transactionTypesToFilterOut;
}

public void init()
{
    QueryBuildRange         criteriaStatusReceipt;
    QueryBuildDataSource    qbdsInventTransOrigin;
    QueryBuildDataSource    qbdsInventTrans;

    super();

    qbdsInventTransOrigin = this.query().dataSourceTable(tableNum(InventTransOrigin));
    qbdsInventTrans       = this.query().dataSourceTable(tableNum(InventTrans));

    qbdsInventTrans.      addGroupByField(fieldNum(InventTrans,      DateExpected));
    qbdsInventTransOrigin.addGroupByField(fieldNum(InventTransOrigin,ReferenceCategory));
    qbdsInventTransOrigin.addGroupByField(fieldNum(InventTransOrigin,ReferenceId));
    qbdsInventTrans.      addGroupByField(fieldNum(InventTrans,      TransChildType));
    qbdsInventTrans.      addGroupByField(fieldNum(InventTrans,      TransChildRefId));
    qbdsInventTransOrigin.addGroupByField(fieldNum(InventTransOrigin,ItemId));
    qbdsInventTransOrigin.addGroupByField(fieldNum(InventTransOrigin,Party));
    qbdsInventTrans.      addGroupByField(fieldNum(InventTrans,      TableId));
    qbdsInventTrans.      addGroupByField(fieldNum(InventTrans,      StatusIssue));
    qbdsInventTransOrigin.addGroupByField(fieldNum(InventTransOrigin,RecId));             // Used reservation button

    qbdsInventTrans.addSelectionField(fieldNum(InventTrans, Qty), SelectionField::Sum);

    criteriaStatusIssue   = qbdsInventTrans.addRange(fieldNum(InventTrans,StatusIssue));

    criteriaStatusReceipt = qbdsInventTrans.addRange(fieldNum(InventTrans,StatusReceipt));
    criteriaStatusReceipt.value(queryValue(StatusReceipt::None));
    criteriaStatusReceipt.status(RangeStatus::Locked);

    qbdsInventTransOrigin.addRange(fieldNum(InventTransOrigin, ReferenceCategory)).value(this.getUnsupportedTransactionTypesQueryRangeStr());
}

