private str getUnsupportedTransactionTypesQueryRangeStr()
{
    str inventTransTypeRangeStr = '';

    SetEnumerator unsupportedTransactionTypesEnumerator = element.getUnsupportedTransactionTypes().getEnumerator();
    while (unsupportedTransactionTypesEnumerator.moveNext())
    {
        InventTransType unsupportedTranscationType = unsupportedTransactionTypesEnumerator.current();

        if (inventTransTypeRangeStr)
        {
            inventTransTypeRangeStr += ',';
        }

        inventTransTypeRangeStr += strFmt('!%1', enum2Str(unsupportedTranscationType));
    }

    return inventTransTypeRangeStr;
}

public void executeQuery()
{
    Query                   query   = new Query();
    QueryBuildDataSource    qbs     = query.addDataSource(tableNum(InventTrans));

    qbs.addRange(fieldNum(InventTrans,InventTransOrigin)).value(queryValue(inventTransOrigin.RecId));
    qbs.name(inventTransButton_ds.name());
    this.query(query);

    super();
}

public display HcmPersonnelNumberId responsible(InventTransOrigin _inventTransOrigin)
{
    WorkerSalesResponsible responsible;

    switch (_inventTransOrigin.ReferenceCategory)
    {
        case InventTransType::Sales :
            responsible = SalesTable::find(_inventTransOrigin.ReferenceId).WorkerSalesResponsible;
            return HcmWorker::find(responsible).PersonnelNumber;
        default :
            return '';
    }
}

public void executeQuery()
{
    QueryBuildDataSource queryBuildDataSource;

    switch (element.args().dataset())
    {
        case tableNum(InventSum):
            queryBuildDataSource = inventTransOrigin_q.dataSourceTable(tableNum(InventTransOrigin));
            queryBuildDataSource.addDynalink(fieldNum(InventTransOrigin, ItemId), element.args().record(),
                            fieldName2id(element.args().dataset(),fieldStr(InventTransOrigin,ItemId)));

            InventDim::queryAddSortFromCaller(this.query().dataSourceTable(tableNum(InventDim)),element.args());
            inventDimParm.initFromQueryCallerGroupBy(element.args());
            inventDimParm.queryAddGroupByField(this.query().dataSourceTable(tableNum(InventDim)));
            element.updateDesign(InventDimFormDesignUpdate::Init);
            break;

        default:
            inventDimParm.setAllInventDim();
            inventDimParm.queryAddGroupByField(this.query().dataSourceTable(tableNum(InventDim)));
            break;
    }

    if (showAllValue)
    {
        showStatusOnOrder           = NoYes::No;
        showStatusReservedOrdered   = NoYes::No;
        showStatusReservedPhysical  = NoYes::No;
        ctrlShowOnOrder.enabled(false);
        ctrlShowReservedOrdered.enabled(false);
        ctrlShowReservedPhysical.enabled(false);
    }
    else
    {
        ctrlShowOnOrder.enabled(true);
        ctrlShowReservedOrdered.enabled(true);
        ctrlShowReservedPhysical.enabled(true);
    }

    criteriaStatusIssue.value(element.statusSelectionStr());

    super();
}

public int active()
